/* Master CSS file*/
/* Use comments to describe what stuff is for! */
footer {
   position:absolute;
   bottom:0;
   width:100%;
   height:60px;
}

textarea {
   resize: none;
}
body {
	font-family: Arial;
	margin:0px;
	padding:0px;
	background-color:#606E7F;
	color: black;
	text-align: center;
}
header
{
	padding-top: 5px
}
h1 {
	color: rgb(47, 47, 48);
	font-size: 42px;
	font-weight: 600;
	text-align: center;
}
h2 {
	color: rgb(47, 47, 48);
}
p{
	font-size: 50x;
}
img {
	padding-top: 50px;
}
table, th, tr, td{
	border: 1px solid black;	
	position: center;
	color: rgb(47, 47, 48);
   	border-collapse: collapse;
	text-align: left;
	border-spacing: 5px;
	padding: 2px 10px;
	vertical-align: middle;
	background-color: white;
}
table {

	border-collapse: collapse;
	background-color: #eaecef;
	border:1px solid $color-form-highlight;
	text-align: center
}

th {
	color: black;
	background-color: #eaecef;
	font-size: 15px;
	text-align: center
}
table form {
    margin: 0;
	padding-top: 0px;
	vertical-align: middle;
}
.btn 
{
    -webkit-transition-duration: 0.4s;
    transition-duration: 0.4s;
	height: 2.2em;
}
.btn:hover 
{
    background-color: black;
	color: white;
	border-color: white;
	height: 2.2em;
}
.response {
	background-color: white;
	position:absolute;
	top:0;
	bottom:0;
	left:0;
	right:0;
	width: 500px;
	overflow-x: auto;
}
.backButton {
	padding-left: 925px;
}
.whitetext {
	color: white;
}
.toppadding {
	padding-top:15px;
}
.submissionButtons {
	max-height:2.1em;
}
.paddingbottom {
	padding-bottom:20px;
}
#buttonContainer
{
	float: center;
	padding: 3%;
	width: 40%;
	display: inline-block;
}
#yesButton
{
	float: left;
}
#noButton
{
	float: right;
}
#pButton
{
	float: left;
}
#backButton
{
	float: center;
}

#spacer
{
	/*so there's space between the table and the titlebar*/
	padding: 30px;
}
#hoursRequest
{
	padding-top: 30px;
	padding-bottom: 10px;
}

#descriptionBox{
	width: 800px;
	height: 400px;
	padding-bottom: 450px;
	word-wrap: break-word;
	font-family: "Times New Roman", Times, serif;
	font-size: 17px;
}
#titlebar 
{
	margin-bottom:0px;
	width: 100%;
	padding: 6px 0px 6px 0px;
	background-color: Gray;
	filter: alpha(opacity=60);
	color: white, 0.9;
	text-align: center;
	position: relative;
	font-size: 48px;
	font-family: Arial;
	font-style: normal;
	font-stretch: expanded;
}


/* Style the tab */
div.form{
	overflow: hidden;
    background-color: rgb(47, 47, 48);
	text-decoration: none;
	color: white;
	text-align: center;
	padding: 50px;
}
div.tab {
    overflow: hidden;
    background-color: rgb(47, 47, 48);
	text-decoration: none;
	color: white;
}

/* Style the buttons inside the tab */
div.forms button {
    background-color: rgb(47, 47, 48);
    float: center;
    border: none;
    outline: none;
    cursor: pointer;
	padding: 50px;
    transition: 0.3s;
	color: white;
	
}
div.tab button {
    background-color: rgb(47, 47, 48);
    float: left;
    border: none;
    outline: none;
    cursor: pointer;
    padding: 14px 16px;
    transition: 0.3s;
	color: white;
	
	
}

/* Change background color of buttons on hover */
div.forms button:hover {
    background-color: gray;
	text-decoration: none;
}
div.tab button:hover {
    background-color: gray;
	text-decoration: none;
}

/* Create an active/current tablink class */
div.forms  button.active {
    background-color: black;
	text-decoration: none;
}
div.tab button.active {
    background-color: black;
	text-decoration: none;
}

/* Style the tab content */
.tabcontent {
    display: none;
    padding: 6px 12px;
    border: 1px solid ;
    border-top: none;
	text-decoration: none;
}

div.forms a:link {
	color: white;
	text-decoration: none;
}
div.tab a:link {
	color: white;
	text-decoration: none;
}

div.forms a:visited {
	color: white;
	text-decoration: none;
}
div.tab a:visited {
	color: white;
	text-decoration: none;
}

div.forms a:hover {
	color: black;
	text-decoration: none;
}
div.tab a:hover {
	color: black;
	text-decoration: none;
}

div.forms a:active {
	color: black;
	text-decoration: none;
}
div.tab a:active {
	color: black;
	text-decoration: none;
}

div.logo {
	padding: 350px;
}

.btn {
	min-width: 58px;
	vertical-align: middle;
	-webkit-border-radius: 2px;
	-moz-border-radius: 2px;
	border-radius: 14px;
	color: #ffffff;
	font-size: 14px;
	background: #505050;
	height: 2.5em;
	padding: 2px 20px 2px 20px;
	border: solid #000 1px;
	text-decoration: none;
	display: block;
	margin: 0;
	vertical-align: middle;
}

.sortbtn {
	min-width: 58px;
	vertical-align: middle;
	-webkit-border-radius: 2px;
	-moz-border-radius: 2px;
	border-radius: 8px;
	color: #ffffff;
	font-size: 14px;
	background-color: #008CBA;
	padding: 2px 20px 2px 20px;
	border: solid #000 1px;
	text-decoration: none;
	vertical-align: middle;
	height: 2.5em;
}

.btn:hover {
	background: #666;
	text-decoration: none;
	height: 2.5em;
}
